La espinaca es un planta cuyas hojas verdes se consume de manera muy popular y diferente en el mundo. Cocinas son una delicia culinaria, pero crudas conservan aún más sus propiedades y beneficios nutricionales (aparte de dar un color verde muy bonito).
:

Entre sus beneficios y propiedades, destaca:

Son antioxidantes, por lo que reducen el estrés oxidativo del cuerpo.
Son buenas para la vistas al ser ricas en zeaxantina y luteína.
Son ricas en vitaminas A, C, K1 y ácido fólico.
También son fuente de hierro y calcio, altas para ser un vegetal (por ello las recomiendan en dietas veganas).
Por ello, es muy recomendable introducir este tipo de vegetal de hoja verde en la dieta y qué manera más fácil que un batido. Además, mezcladas con frutas están deliciosas y nos pueden ayudar a nuestros objetivos nutricionales: perder peso, comer más sano, tomar más vegetales, tomar más hierro, prevenir enfermedades, romper un ayuno con algo ligero y digestivo etc.
